import React from 'react';

const Examination = () => {
    const [examinations, setExaminations] = useState([]);

    useEffect(() => {
        fetch('/examinations')
            .then(res => res.json())
            .then(data => setExaminations(data));
    }, []);

    return (
        <div>
            <h1>Examination List</h1>
            <ul>
                {examinations.map(exam => (
                    <li key={exam.id}>{exam.name}</li>
                ))}
            </ul>
        </div>
    );
};

export default Examination;
